import formatDate from "../../util/formatDate";

const tableData = (typeData, data) => {
  switch (typeData) {
    case "phoneNo":
      return "+" + data;
    case "createdDate":
      return formatDate(data, "UTC");

    default:
      return data;
  }
};

export default tableData;
